import React from 'react';
import MyPageHeader from './myPage_header';
import MyPageCategory from './myPage_category';
import MyPageMenu from './myPage_menu';
import MyPageProfile from './myPage_profile';
import MyPageChat from './myPage_chat';
import MyPageProduct from './myPage_product'; // ✅ 대여상품 컴포넌트
import '../../css/myPage/myPage.css';

function MyPage() {
  return (
    <div>
      <MyPageHeader />
      <MyPageCategory />
      <div className="mypage-body">
        <div className="menu-wrapper">
          <MyPageMenu />
        </div>
        <div className="right-section-wrapper">
          <div className="profile-wrapper">
            <MyPageProfile />
          </div>
          <MyPageChat />
          <MyPageProduct /> {/* ✅ 채팅 바로 밑으로 옮김 */}
        </div>
      </div>
    </div>
  );
}

export default MyPage;
